INSERT INTO `clanky` (`id`, `date`, `nadpis`, `text_small`, `text_big`, `autor`, `pic`, `precitane`) VALUES
(1, 1138834800, 'Vítame vás na stránkach weno crew!', '<SPAN CLASS=\"med\">Z historie:</SPAN><BR>Weno crew vznikla asi pred dvoma rokmi, kedy dvaja chalani, ktorý spolu chodievali kalit, jazdit a zdielali rovnaký ?ivotný zmysel: Hip-Hop sa rozhodli, ze by sa tá ich particka mohla neak volat, tak vznikla Weno crew. Bol to prave wirusov napad...<BR><A HREF=\"site.php?x=1&id=1\"><B>VIAC...</B></A>', '<SPAN CLASS=\"med\">Z histórie:</SPAN>Weno crew vznikla asi pred dvoma rokmi, kedy dvaja chalani, ktorý spolu chodievali kalit, jazdit a zdielali rovnaký ?ivotný zmysel: Hip-Hop sa rozhodli, ze by sa tá ich particka mohla neak volat, tak vznikla Weno crew. Bol to prave wirusov napad to \"weno\" myslel tym, to, ze veci ktoré robíme máme v tele uz od narodenia, dostali sme ich do \"vena\". Nebudem tu zatial pisat, kto co robi, dolezite je, ze to robi zo srdca a hlavne pre seba.', 'admin', , 65),
(2, 1152223200, 'Konecne je tu LZK!!!', '<B>Dalsi level...</B><BR>Takze, uz od februara na nete strasi stranka Weno-crew. Je to dobra stranka, ale uz od zaciatku sme citili, ze to nebude take jednoduche, pretoze materialu je dost, ale hlavne materialu od BT crew a kedze Weno crew ide s BT crew ruku v ruke kazdy svoj velky i maly zacmudeny krok rok co rok, tak sme sa rozhodli...<BR><A HREF=\"site.php?x=1&id=2\"><B>VIAC...</B></A>', '<B>Dalsi level...</B><BR>Takze, uz od februara na nete strasi stranka Weno-crew. Je to dobra stranka, ale uz od zaciatku sme citili, ze to nebude take jednoduche, pretoze materialu je dost, ale hlavne materialu od BT crew a kedze Weno crew ide s BT crew ruku v ruke kazdy svoj velky i maly zacmudeny krok rok co rok, tak sme sa rozhodli, ze vznikne nova stranka volajuca sa Ludia Z Konca (LZK)!!! Ved koniec koncov, sme skutocny.', 'admin', , 18),
(3, 1152309600, 'Historicky prvy Bike Session v Cadci!!!', '<B>Takto sa pise Historia!!!</B><BR>\r\n<BR>Uz od doby, kedy som zacal jazdit na biku som snival o tom, ze nebudem jazdit sam a ze mi s tym niekto pomoze. Ale zivot na konci je kruty a ziadna pomoc neprisla, tak som bol odsudeny sa so svojim bikom trapit osamoteny. Ale vyzera to tak, ze svita na lepsie casy...<BR><A HREF=\"site.php?x=1&id=3\"><B>VIAC...</B></A>', '<B>Takto sa pise Historia!!!</B><BR>\r\nUz od doby, kedy som zacal jazdit na biku som snival o tom, ze nebudem jazdit sam a ze mi s tym niekto pomoze. Ale zivot na konci je kruty a ziadna pomoc neprisla, tak som bol odsudeny sa so svojim bikom trapit osamoteny. Ale vyzera to tak, ze svita na lepsie casy!!! Pretoze asi pred dvoma mesiacmi som sa zoznamil s Typkom z Cadce, ktory takisto jadzi freestyle MTB a zacali sme vymyslat neaku tu haluz... Co takto zorganizovat historicky prve stretnutie extremnych bikerov v Cadci? A kedze sme neboli sami dvaja, co jazdia, ale aj spriatelene XTM crew jazdiaci flat boli ochotny sa pridat, nebolo co riesit. \r\nVec sa ma tak, ze 02-07-2006 sa v Cadci konal Prvy Bike Session!!!\r\n<BR>Stretli sme sa seci na Zarci, ja som tam dofrcal aj s Petrom, ktory si kupil den predtym BMXu Felt Heretic. A ako moralna podpora z konca este prisli umelci Turque, Filozof a Petrova babenka Lucka(pozdravujem). Na zastavke uz v rade cakali na nas Wifon a MT z XTM crew, Typek z Cadce a Milan, moja spriaznena dusa. Z XTM sa tam dosulal este breaker DaNo so svojou kamaratkou, particka vymazlena, spodina najvecsieho spodku mohla ist likvidovat okresne mesto...:):):)\r\n\r\nZo zarca sme sa presunuli k futbalovemu stadionu na asfaltove ihrisko, kde sa skoro cely session odohraval. Chlalani z XTM ukazali svoje schopnosti a ze na tu dobu, co jazdia neboli male!!! Typek vymakaval manualy a ollies a Milan sa ucil neaku tu trialovu smotanku. Peter sa asi moc dival na streetove videa, comu nasvedcoval aj styl jeho jazdenia. Ja ako stary tato, co setko organizuje som vacsinu casu pobehoval s klucami a pomahal vytunit kamosom stroje... Z ihriska sa slo uz len v zlozeni Wifon, MT, Typek, Milan a ja na autobusovu stanicu, kde sa haluzilo zas, no co cert nechcel, obrubniky su ostre a tak obaja XTMaci prebili kolesa a bolo dojazdene... <BR><BR>Aj napriek zopar drobnostiam, ktore mohli dopadnut inak hodnotim celu session kladne a rozhodne mozem povedat <B>DAKUJEM CHALANI!!!</B> <BR><BR>\r\n\r\nPre fotoze zo session chod cez menu ex-sports-- >bike, alebo klikni <A HREF=\"site.php?x=22\"><B>tu!</B></A>', 'admin', , 43),
(4, 1152396000, 'LZK hostuje Oscadnicku crew XTM!!!', '<B>Welke weci!!!</B><BR>\r\nTakze, ako sme boli na tej bike session v Cadci, tak tam boli aj Flatlanderi Wifon a Martin z XTM crew a chalosi spomenuli, ze maju nafoteny neaky matros, ze by boli radi, keby sa niekde mohli blysnut, a kedze sme tam vtedy boli cele LZK tak sme sa dohodli a...<BR><A HREF=\"site.php?x=1&id=4\"><B>VIAC...</B></A>', '<B>Welke weci!!!</B><BR>\r\nTakze, ako sme boli na tej bike session v Cadci, tak tam boli aj Flatlanderi Wifon a Martin z XTM crew a chalosi spomenuli, ze maju nafoteny neaky matros, ze by boli radi, keby sa niekde mohli blysnut, a kedze sme tam vtedy boli cele LZK, tak sme sa dohodli a...\r\n<BR>XTMaci hostuju na LZK ako kooperacia... Takze sme samozrejme radi, ze sme ich mohli prijat medzi svojich, chalani drzime vam palce, nech vam to da impuzl do dalsieho jazdenia a rozvijania osobnosti!!!\r\n<BR><BR>\r\n<B>Wifon - flatland</B><BR>\r\n<BR>\r\n<B>Martin - flatland</B><BR>\r\n<BR>\r\n<BR>\r\nPre fotoze a profily XTMakov cekuj menu XTM crew, alebo klikni <A HREF=\"site.php?x=2\"><B>tu!</B></A>', 'admin', , 27),
(5, 1153432800, 'Profil pSw/Lukash (Weno crew)', 'Abysivedel, kto a co to vlasne je v tom LZK, tak ti prinesem priamo do papule cas od casu profil neakeho borca z konca!!!\r\nAko prvy sa na paskvil dostal samotny tato tejto kultovej stranky Lukash a.k.a. pSw!<BR>\r\nNebudem kok*tiny trepat, som to ja samozrejme...tak cekuj neake info o mojej osobe...<BR><A HREF=\"site.php?x=1&id=5\"><B>VIAC...</B></A>', 'Abysivedel, kto a co to vlasne je v tom LZK, tak ti prinesem priamo do papule cas od casu profil neakeho borca z konca!!!\r\nAko prvy sa na paskvil dostal samotny tato tejto kultovej stranky Lukash a.k.a. pSw!<BR>\r\nNebudem kok*tiny trepat, som to ja samozrejme...tak cekuj neake info o mojej osobe...<BR><BR>\r\n\r\n<B>Kto si?</B><DIV CLASS=\"tiny\"> </DIV>\r\nClen Weno crew, admin tejto stranky, bike rider, snowboarder.\r\n<BR><BR>\r\n\r\n<B>Narodeny?</B><DIV CLASS=\"tiny\"> </DIV>\r\n\'\'85 stary cap...\r\n<BR><BR>\r\n\r\n<B>Ako dlho sa venujes?</B><DIV CLASS=\"tiny\"> </DIV>\r\nNajprv som zacal jazdit na biku, co ma drzi do az teraz. Potom som si ale kupil SK8 a zacal sa haluzit na nom, ale v koncoch su na street podmienky na kkt, tak som s tym sekol. Ale so SNB to uz je pelsie a kazdu zimu sa haluzim na neakom skoku, ci zraze, drope, freeride...\r\n<BR><BR>\r\n\r\n<B>Daj viac o tom biku!</B>\r\n<DIV CLASS=\"tiny\"> </DIV>\r\nNa biku jazdim od prvej triedy na strednej, kedy bol moj prvy trik zdvihnutie predneho kolesa do vysky 10 cm...no uplny moor! Tak sa mi to zapacilo, ze som si povedal, ze toto musim!!! Ale asi rok na to mi ukradli bike a dal som si tak na rok prestavku, kym som zarobil na novy. Ak mi aj ten ukradnu, tak si zhanajte noveho admina na stranku bo to tu skoncim...\r\n<BR><BR>\r\n\r\n<B>No a nieco o Weno crew?</B>\r\n<DIV CLASS=\"tiny\"> </DIV>\r\nJasne Weno vzniklo uz dost davno, som jej clenom, vlastne to je historicky prva crew na Bystriciach...hehe.\r\n<BR><BR>\r\n\r\n<B>Sponzori?</B><DIV CLASS=\"tiny\"> </DIV>\r\nV podstate len ja, a to je aj problem, ze kym na daco zarobim, tak sa pripravujem o drahocenny cas, ale aj rodicia sem-tam prispeju, tak 15-20%...takze nie, niesom ten, ktoremu setko kupia maminky a oni potom zo seba robia velkych killerov, takmer vsetko mam zo svojho...deticky :)\r\n<BR><BR>\r\n\r\n<B>Neaky odkaz pre ostatnych, podakovanie?</B>\r\n<DIV CLASS=\"tiny\"> </DIV>\r\nTak dakujem vsetkym, co ma podporuju a to hlavne Janovi(respekt najvecsi), potom dlho dlho dlho nic a potom vsetci ostatny...mier. <BR>\r\n<DIV CLASS=\"tiny\"> </DIV>\r\nA odkaz? Nedrogujte uz a robte cosi pre seba, mna ide tiez jebnut, ked vidim tento svet, ale bude to stale take iste, ci budes zjebany na prach, ci vyhecovany zo svojej tvorby...', 'admin', , 24);
INSERT INTO `clanky` (`id`, `date`, `nadpis`, `text_small`, `text_big`, `autor`, `pic`, `precitane`) VALUES
(6, 1153432800, 'Oscadnica Bike Session vol.1', '<B>Dalsia akcia</B><BR>\r\nKedze LZK to neflaka, ale maka, tak sa zase zopar z nas vyhaluzilo na bajky aby sme potrapili uz ajtak dost rozbite klby a ztuhnute svaly. <BR>\r\nV zlozeni Wifon, Martin, Milan a Lukas zme si dali historicky prvu freestyle bike session v dedinke pod Racou zvanej OSCadnica....<BR><A HREF=\"site.php?x=1&id=6\"><B>VIAC...</B></A>', '<B>Dalsia akcia</B><BR>\r\nKedze LZK to neflaka, ale maka, tak sa zase zopar z nas vyhaluzilo na bajky aby sme potrapili uz ajtak dost rozbite klby a ztuhnute svaly. <BR>\r\nV zlozeni Wifon, Martin, Milan a Lukas zme si dali historicky prvu freestyle bike session v dedinke pod Racou zvanej OSCadnica....\r\n<BR><BR>\r\n\r\nZacalo to asi tak, ze sme sa secja stretli v centrume a odtial sli na asfaltove ihrisko ku skole. Taka fajna zahrievacka, vlasne az moc velka zahrievacka, bo bolo tak teplo, ze sme boli mokry ako zena v tom najlepsom... <BR><BR>\r\n\r\nOdtial sme sli k takej bielej budove, kde sa stalo vela zaujimavych veci... Hned potom ako sme zistili, ze sa ta budova preraba, cize sa v nej nedalo jazdit, tak Wifonovi chudakovi zas z nevysvetlitelnych dovodov vyfucalo koleso :(. Potom som ja skusal vyskocit na lavicku a neak som to nedal a ohol som stred... a dotretice som este urbil aj ja defekt... Tak sme sli zalepit tie kolesa k Martinovy domov (zdravim Tibora). A odtial pekne na pifko, lebo toho tepla bolo uz moc... <BR><BR>\r\n\r\nPosilneni zivotadarnou tekutinou sme jazdili do dlhych nocnych hodin v centrume... Wifon daval tie svoje preslapove kreacie, ktore zas nikto nechapal, Martin daval svoje balancovo-whipove kreacie, Milan vychytaval rovnovahu a ja som vychytaval manualy a pedalkicky.<BR><BR>\r\n\r\nTakze aj napriek neakym technicko-tepelnym problemom to vydim na dalsiu vydarenu akciu, dufam, ze takych bude len viac a viac...mier Ludia!!!<BR><BR>\r\n\r\nPre fotoze zo session chod cez menu ex-sports-- >bike, alebo klikni <A HREF=\"site.php?x=22\"><B>tu!</B></A>', 'admin', , 54),
(7, 1154642400, 'Mam novy bajk :D', 'Tak som dosiel z teplych krajin, kde som bol pracovat a doniesol so sebou novy bajk... \r\n<BR>Jedna sa o Kanadsku znacku Norco, ktora sa specializune na North Shore a extremne discipliny...model Norco 125 06 \r\n<BR>Tak cekujte hovadaaah....<BR><A HREF=\"site.php?x=1&id=7\"><B>VIAC...</B></A>', 'Tak som dosiel z teplych krajin, kde som bol pracovat a doniesol so sebou novy bajk... \r\n<BR>Jedna sa o Kanadsku znacku Norco, ktora sa specializune na North Shore a extremne discipliny...model Norco 125 06 \r\n<BR>Tak cekujte hovadaaah....\r\n<BR>\r\n<BR>\r\n\r\n<IMG SRC=\"/x/09-08-06_1522.jpg\" BORDER=\"1\">', 'admin', , 51),
(8, 1154815200, 'Orange Hip-Hop Fest 2006', 'Od 4.8 do 6.8 sa konal Prvy slovensky Hip-Hopovy fertival pod nazvom Orange Hip-Hop fest 2006 a LZK bolo pri tom...\r\n\r\n<BR><BR>\r\n\r\nCele sa to zacinalo az v Piatok vecer o 18:00, takze kym sme seci prisli, bolo dost casu rozbalit stany, zcekovat jazero a okolie... Dokopy nas tam bolo zo seweru asi 15 secia pekne pohromade.<BR><A HREF=\"site.php?x=1&id=8\"><B>VIAC...</B></A>', 'Od 4.8 do 6.8 sa konal Prvy slovensky Hip-Hopovy fertival pod nazvom Orange Hip-Hop fest 2006 a LZK bolo pri tom...\r\n\r\n<BR><BR>\r\n\r\nCele sa to zacinalo az v Piatok vecer o 18:00, takze kym sme seci prisli, bolo dost casu rozbalit stany, zcekovat jazero a okolie... Dokopy nas tam bolo zo seweru asi 15 secia pekne pohromade. \r\n<BR>\r\n<HR>\r\n<BR>Line Up vyzeral dost hu100!!!\r\n<BR>\r\n<BR>Freestyle Battle s DJ\'\'s (Kappa, Grimaso, Lucco) \r\n<BR>DJ Fazo\r\n<BR>DJ Hajtkovic\r\n<BR><B>Nazov Stavby</B>\r\n<BR>Do rana vsetci DJs (Fazo, Kappa, Grimaso, Hajtko, Lucco)\r\n<BR>\r\n<BR>V SonyEricsson breaking stane bol Battle 1 na 1ho a potom skupiny battle.\r\n<BR>ExJumpers s Ivanom Draskovicom\\\r\n<BR>ExJumpers - elektroboogie\\r\\n<BR>freestyle ExJumpers\r\n<BR><BR>\r\n<HR>Na Sobotu asi takto:\r\n<BR>\r\n<BR>DJ Fazo\r\n<BR>Disgrafix /cz/\r\n<BR>Kaidzas /sk/\r\n<BR>Miky Mora /sk/\r\n<BR>DJ Grimaso /sk/\r\n<BR>AMO /sk/\r\n<BR>Drviva Mensina /sk/\r\n<BR>H16 /sk/\r\n<BR>DJ Hajtkovic\r\n<BR>Cistychov /sk/\r\n<BR>Indy a Wich /cz/\r\n<BR>PSH /cz/\r\n<BR>Rytmus - Bengoro Show /sk/\r\n<BR>Kontrafakt - Live Band /sk/\r\n<BR><B>Bolesna Braca /croatia/ + DJ Phat Phille</B>\r\n<BR><B>Tha Alkaholiks  /USA/</B>\r\n<BR>\r\n<BR>V breakerskom SonyEricsson stane boli ExJumpers, HipHop Facujta Johny s Mel, Street Dance Academy Laci Strike\r\n<BR>\r\n<BR>\r\n<HR>Komu sa chce, nech precita daco viac o tom, komu sa nechce, nech klikne dole na odkaz pre fotoze...\r\n<HR>\r\n<BR><B>Piatok</B><BR>\r\nOd 18:00 zacali hrat DJ\'\'s svoje veci a my sme poobzerali areal boli tam Hlavny stage, Breakersky SonyEricsson stan, Orange stan, kde sa dali nabit telefony, DJ\'\'s stan, kde sa cele dni len hrala Hip-Hop muzika, nieco ako klub a asi 5 obcerstvovacich stanov a podobnych sraciek... Zaujimava bola ale aj 60 metrova stena na grafitti, ktora skoncila cela pekne pomalovana(cekuj foto).\r\n<BR><BR>Ako sa tak zacalo stmievat, tak zacal aj freestyle battle, de bolo neuveritelnych 31 freestylerov, ale trea dodat, ze vecsina deti... No kazdopadne tam bol aj Vitaz AAFB 2006 Strapo, ktory kruto zadelil. Asi po hodine a pol bolo semifinale, do ktoreho postupil strapo a Typek, mlady chalanisko, ktory viac picoval ako rymoval, a mozno aj vdaka tomu si ziskal dav malych deti, ktorym nezalezi na texte a vyhral nad Strapom... Strapo vyhukane sa diva, ze cooo??? Ale typek vedomi si situacie zamachroval a z vyhry 20 litrov si zobral len 10 a zbytok nehal rozdelit medzi ostatnych, medzi ktorymi boli aj Peto, Sketa a ini, co pekne nakladali...\r\n<BR>\r\n<BR>Pol hodky na to sa uz zacali davy zbierat na Nazov Stavby a kazdy vedel, ze to neni len tak ich vidiet setkych pekne pokope... Koncert bol super, ale najlepsia bola ajtak posledna vec Statanuti, ked Slipo na zaciatku zacal davat: \"Tato vec je o tom, do coho ta nuti stat, o ludoch, ako su Fico a podobni, FICO nas nuti zit tak, jak zijeme!!!!\" No moor, ked som to pocul...respect...\r\n<BR>\r\n<BR>\r\n<BR><B>Sobota</B>\r\n<BR>Tazke bolo poopicne prebudzanie v sobotu, no dalo sa, ked sme to setko pekne pocas dna znova dohnali na podovnu hladinu :D:D:D Kempovali sme pred stanmi az do 14:00, kedy zacal znova LuneUp.\r\n<BR>\r\n<BR>Rozbehol to DJ Fazo a ponom hned Disgrafix z Mikulova, ktory davali svoju klasiku a tam sa hned ukazalo, ze slovenske deti nemaju ani paru o tom, kto je to El Nino a co je to Vandal bombing...\r\n<BR>\r\n<BR>Dalsi bol Kaidzas a Abysi, co davali svoje nove veci, ale aj stare veci zo Zdruzenia.\r\n<BR>Po nich to hned odpalil Miky Mora so svojim 5trzalskym dialektom...respect...\r\n<BR>Chvilocka pauzy s Grimasom za gramcami a po nom hned AMO so svojim rymovo freestyleovym vystupenim a mam taky pocit, ze Moe Pribral a Amen naopak schudol...\r\n<BR>\r\n<BR>Po nich na platz nastepovali De Em V Sieti Zla. Kvalitna sou az na poskrabane skakacie CDcka...\r\n<BR>\r\n<BR>H16...tak od nich som cakal najmenej a dostal som najviac, hadam dvojhodinovu sou dali tak kruto a tak energicky, ze museli hadam na niecom frcat....respekt..\r\n<BR>Nove aj stare veci a dokonca aj seci stihali do toho doubletimoveho textu vo veci Nejsom Falosny!!!\r\n<BR>\r\n<BR>Zase pauza s Hajtkom za 12 palcami a potom Cistycov, co dal svoju klasicku sou, skoda ze nedosla Tina, ale zato veci s Miky Morom stali za to...\r\n<BR>\r\n<BR>Uz bola tma a na podium vtrhne neger, ja ze co??? NI!!! Za nimi Indy a Wich!!! Kruta Americko ceska show...rozhadzane platne a redbully...spokojnost...\r\n<BR>\r\n<BR>Potom zacala pre slovenske deti asi najlepsia cast vecera a sice Rytmus a po nom Kontrafakt, zabite ma, ale ja som isiel do stanu...mam svoje dovody...vraj tam bolo popici vela ludi, popici velka show...\r\n<BR>\r\n<BR><B>Bolesna Braca</B> Kapela, na ktoru som sa tesil najviac a dostal uz menej, bolo to mozno tym dazdom a tym malym poctom ludi (asi boli unaveni z KF a museli kuknut vecernik a spat). Ale ajtak DJ Phat Phille respect Braca RuleZz..\r\n<BR>\r\n<BR>Uz viac ludi ale prislo na headlinera <B>Tha Alkaholiks</B>! Kvalitna Americka show, proste jak vtrhne neger na podium, tak je hned kazdemu jasne, preco nemoze byt biely nikdy taky dobry rapper ako cierny... Zavratny skoro 3 hodiny az do rana, proste profesionali najvecsieho kalibru, ich klasicke veci a velke vzdavanie respektu pre Ol\'\'Dirty Bastarda... Dufam, ze sa im pacilo...\r\n<BR>\r\n<BR>\r\n<BR>Ak si sa docital az tu, tak dik a lutuj, ze si nedosiel, pretoze toto bola Proste AKCIA ROKA 2006!!!\r\n\r\n\r\n<BR><HR><BR>\r\n<A HREF=\"site.php?x=49\"><B>Pre fotoze z akcie klikaj sem.</B></A> Alebo chod cez menu <B>Parties -> Orange Hip-Hop fest</B>', 'admin', , 93);
INSERT INTO `clanky` (`id`, `date`, `nadpis`, `text_small`, `text_big`, `autor`, `pic`, `precitane`) VALUES
(9, 1155420000, 'Mame nove Fotoze z Hip-Hop Festu!!!', 'Len narychlo....Junior z Kysuce, co bol tiez na feste poskytol svoje fotoze z tej zverskej akcie...tak ich kuknite....Je ich tam 34 a chalani sa fotili hadam so vsetkymi ucinkujucimi :D:D:D \r\n<BR>\r\n<BR><BR><A HREF=\"site.php?x=1&id=9\"><B>VIAC...</B></A>', 'Len narychlo....Junior z Kysuce, co bol tiez na feste poskytol svoje fotoze z tej zverskej akcie...tak ich kuknite....Je ich tam 34 a chalani sa fotili hadam so vsetkymi ucinkujucimi :D:D:D \r\n<BR>\r\n<BR>\r\n<BR>\r\n\r\n<A HREF=\"site.php?x=49\"><B>Takze bud klikaj sem.</B></A> Alebo chod cez menu <B>Parties -> Orange Hip-Hop fest</B>', 'admin', , 64),
(10, 1156024800, 'Turzovka Bike Session numero uno!', 'Tak zme sa zaskyH vyhaluzeli na kolieska a sadli na Makovsku strelu a vystrelili smer Turzovka :D <BR>V zlozeni az Pastwos a Typek sme sli ojibovat novy SK8park v Turzovke<BR><BR><BR><A HREF=\"site.php?x=1&id=10\"><B>VIAC...</B></A>', 'Tak zme sa zaskyH vyhaluzeli na kolieska a sadli na Makovsku strelu a vystrelili smer Turzovka :D <BR>V zlozeni az Pastwos a Typek sme sli ojibovat novy SK8park v Turzovke<BR><BR>\r\n\r\nAkoze cakal som viac ako len jeden Funbox mikro rozmerov s pripojenym radiusom...clovek si povie, ze sak pohoda ne? ale ne, je to tak uzke, ze ked vyletis co i len torska mimo tak sa len divas kde si zlomis ruku ked sa vyj*ebes mimo....Ale inak som spokojna a aj Typek, ved to mame radi....peace<BR><BR>\r\nPre fotecky stlac klikatko na svojom hlodavcovi <A HREF=\"site.php?x=22\"><B>tu!</B></A> <B>Alebo cez menucko Ex-Sports -- > Bike</B>', 'admin', , 90),
(12, 1156370400, 'Boli sme pojazdit..:)))', 'Sme sa vybrali ja a Johann pojazdit a len tak pokecat po dlhej dobe do Starej na Street...<BR><BR>Vsetko bolo ok az do tej doby, ked sme prisli na to, ze Jankovi ukradli kokoti jebly bike!!! Niezeby bol drahy, niezeby ho mal extra rad, ale TOTO SA KURVA NEROBI!!! Tak sme rychlo pobehali celu bystricku dolinu ja na biku Jano so svagrom na aute...<BR><A HREF=\'site.php?x=1&id=12\'><B>VIAC...</B></A>', 'Sme sa vybrali ja a Johann pojazdit a len tak pokecat po dlhej dobe do Starej na Street...Vsetko bolo ok az do tej doby, ked sme prisli na to, ze Jankovi ukradli kokoti jebly bike!!! Niezeby bol drahy, niezeby ho mal extra rad, ale TOTO SA KURVA NEROBI!!! Tak sme rychlo pobehali celu bystricku dolinu ja na biku Jano so svagrom na aute...\r\n<BR>\r\n<BR>\r\nJa uz som bol takmer v koncoch, tak som zavolal Janovi, ze nic som nenasiel a on mi hovori, ze ked isiel s tym svagrom ze naraz zbadai 15-rocneho typka na JEHO BIKU!!! Okamzite za nim samozrejme, ale typek zahol do bocnej ulicky, hodil bike o zem a zdrhol cez rieku....ale nedostane sa daleko,..Jano ho pozna....kiezby som mu mohol naplut do tvare a povedat mu, ze toto sa nerobi!!!....<BR><BR>Ale klud...nakoniec vsetko dobre dopadlo a z dnesneho vecera mam dobre pocity zo stretnutia s mojim Homiem Weno crew...respect .....Cekuj foto <A HREF=\'site.php?x=22\'><B>tu!</B></A> <B>Alebo cez menucko Ex-Sports -- > Bike</B>', 'admin', , 80),
(13, 1156629600, 'Stara Bystrica Bike session 1', 'Nedela, pekne pocasie, dve nove BMXy na novej, ...cize pastwos, pether, vlado, david...tot smrtelna kombinacia...tot perfektne pojazdenie...<BR><BR><BR><BR><A HREF=\'site.php?x=1&id=13\'><B>VIAC...</B></A>', 'Nedela, pekne pocasie, dve nove BMXy na novej, ...cize pastwos, pether, vlado, david...tot smrtelna kombinacia...tot perfektne pojazdenie...<BR><BR><BR>\r\n\r\nTak sme sa neak dohodli a pomaly sa presuvali so Starej na skolak, tam sme fajne pojazdili na lavickach, chalani ma prekvapili, ze sa toho vobec nabali a sli aj do istych padov..respect....a ja som si tak skakal cez flasu z mineralky a napadlo ma, ze tam dam ruksak, tak som skocil aj ten a vravim si...co takto dve flase???<Br>\r\nEste teraz z toho nechapem, ale 70cm..a nemam som problem to skocit 2x za sebou...(radost)...<BR>\r\nPotom sme este pojazdili na namesti a sli domov...diky chalosi...jazdite a nekaprujte.... <BR><BR>.....Cekuj foto <A HREF=\'site.php?x=22\'><B>tu!</B></A> <B>Alebo cez menucko Ex-Sports -- > Bike</B>', 'admin', , 49),
(14, 1157234400, 'Cadca Bike Session vol 2', 'Dnes sa zase uskutocnil dalsi Bike Session v Cadci...particka kamaratov, bikerov, ludi z konca boli pojazdit...<br>\r\nZo zaciatku to vyzeralo slubne, az 12 bikerov sa malo dostavit, ale zial nakoniec AZ 4ria sme dosli, aspon daco....<br><br><BR><A HREF=\'site.php?x=1&id=14\'><B>VIAC...</B></A>', 'Dnes sa zase uskutocnil dalsi Bike Session v Cadci...particka kamaratov, bikerov, ludi z konca boli pojazdit...<br>\r\nZo zaciatku to vyzeralo slubne, az 12 bikerov sa malo dostavit, ale zial nakoniec AZ 4ria sme dosli, aspon daco....<br><br>\r\n\r\nZacali sme asi okolo 13:00, pastWos, Typek, Milan a nova tvar Peter z OSC, chalanicko, 13rocny,,ale trea uznat, ze ma talent ...<br>\r\n\r\nZacali sme jazdit pri hokejbalovom ihrisku, kde sme nasli super stenu na wallride, parada. A este sme aj vyhaluzili z mantinelu kicker, takze pohodicka pojazdenie. \r\n<br>Odtial sme sli na namestie ku kinu, ale z odtial nas vyhnal ten hnusny chlap, ze mu nemame rozbijat schody...hajzel....<br>\r\nTak sme pojazdili xvilku na tej rovine a potom sli pred mestsky dom, kde sme davali te schody, super to bolo :-D...<br><br>\r\n\r\n<br><br>Dakujem chalani aspom za taku ucast, a nabuduce dufam seci 12sti ;-)\r\n\r\nNajprv sorry za fotoze, fotak mam na pi*cu, mozete mi ale ak mate zaujem kupit novy...;)<br>\r\nTakze cekuj foto <A HREF=\'site.php?x=22\'><B>tu!</B></A> <B>Alebo cez menucko Ex-Sports -- > Bike</B>\r\n\r\n\r\n', 'admin', , 95),
(15, 1158616800, '!!!OFFICIAL LZK BIKE SESSION!!!', '<B>NA TOTO STE VSETCI CAKALI!!!</B><BR>\r\nPo prvy krat v historii sa nad Cadcanskou oblohou pretrhnu mracna kaprovania a 30.9.2006 sa bude konat <B>PRVY OFICIALNY BIKE SESSION!!!</B>. \r\n<BR><BR>Jedna sa o freestyle podujatie na ktorom bude pre teba cakat na asfaltovej ploche pri futbalovom stadione nadupany sk8 park s nadupanymi jazdcami!!! \r\n<BR>O hudbu tejto pekelnej akcie sa postaraju Dj TheZ(CA) a DJ Soya (CA). <A HREF=\'site.php?x=1&id=15\'><B>VIAC...</B></A><BR><BR>', '<B>NA TOTO STE VSETCI CAKALI!!!</B><BR>\r\nPo prvy krat v historii sa nad Cadcanskou oblohou pretrhnu mracna kaprovania a 30.9.2006 sa bude konat <B>PRVY OFICIALNY BIKE SESSION!!!</B>. \r\n<BR><BR>Jedna sa o freestyle podujatie na ktorom bude pre teba cakat na asfaltovej ploche pri futbalovom stadione nadupany sk8 park s nadupanymi jazdcami!!! \r\n<BR>O hudbu tejto pekelnej akcie sa postaraju Dj TheZ(CA) a DJ Soya (CA).\r\n\r\n<BR><BR>Park bude obsahovat Dva Funboxy, Kruty Wallride a Bank. V stadiu vybavovania su aj prekazky pre skaterov(raily...), takze ak mas zaujem si zajazdit nelen na biku ale aj na doske tiez napis do fora...\r\n\r\n<BR><BR>Uz len dodam, ze sa jedna o akciu s podporou mesta Cadca a zaroven o  oficialnu predakciu akcie Sewer underground party #4.\r\n\r\n<BR><BR> Estek zhrnutie:\r\n<BR> kedy?: <B>30.9.2006(sobota) od 14:00 do 20:00</B> \r\n<BR>kde?: <B> Asfaltova plocha pri futbalovom stadione CA</B> \r\n<BR>kto?: <B>Bikeri, Skateri, Dj Soya, DJ TheZ a TY</B>\r\n\r\n\r\n<BR><BR><BR>\r\n<a href=\"./foto/exsports/bike/lzk_bikesession.jpg\"><img src=\"./foto/exsports/bike/lzk_bikesession.jpg\" Width=\"560\" border=\"1\"></a><BR><BR>', 'admin', , 108);
INSERT INTO `clanky` (`id`, `date`, `nadpis`, `text_small`, `text_big`, `autor`, `pic`, `precitane`) VALUES
(16, 1159826400, 'Report: LZK BIKE SESSION', 'V sobotu 30. Septembra sa v Cadci pri futbalovom stadione konala brutalna akcia historicky prva tohoto typu dovolim si povedat na celych Kysuciach!!! Napad vznikol v mojej hlave, stacilo ho len zrealizovat a vdaka vela ludom, ale hlavne Tomasovi a Typkovi sa to vsetko podarilo, takze cekuj Report !!!<BR><BR><BR><A HREF=\'site.php?x=1&id=16\'><B>VIAC...</B></A>', 'V sobotu 30. Septembra sa v Cadci pri futbalovom stadione konala brutalna akcia historicky prva tohoto typu dovolim si povedat na celych Kysuciach!!! Napad vznikol v mojej hlave, stacilo ho len zrealizovat a vdaka vela ludom, ale hlavne Tomasovi a Typkovi sa to vsetko podarilo, takze cekuj Report !!!<BR><BR><BR>\r\n\r\nJe rano, prichadzam ja s Petrom a totalne preplnenym Favoritom na miesto konania, tak uz cakaju Tomas, Typek, po chvili prichadza Martin... <br> Pozrel som sa tak pred seba smerom na Kycerku a hovorim si...\'Je toto normalne? Nemal by som radsej sediet doma a kaprovat ako to robi vecsina?\' \r\n<br>\r\n<br>\r\nAle kedze pre pastwosa nieje nic nemozne, tak sme zacali makat na skokoch ktore mali sluzit pre ucastnikov Session a celkom sa nam darilo...\r\n<br>Okolo 13:00 sme mali postaveny velky funbox rozmerov asi 150cm na sirku, 120cm na vysku a 6m na dlzku. K tomu jedenu vymazlenu pyramidu s troma odrazmi, takze sa dalo na nej vyhaluzit ozaj naporiadok (ale aj dozabijat). Pre skaterov bol pripraveny rail asi 2m dlhy od chalanov z Kyceky(este raz dik) a drevena plosina na ktoru sa dalo vyskakovat.\r\n<br>Asi o 13:45 prichadzaju obaja avizovani DJ\'s Soya a TheZ, obaja dobre naladeni s plnou vybavou platni ochotni ukazat ostatnym svoje skillz.\r\n<br>V tej dobe bolo na placi uz minimalne 20 navstevnikov, celych nedockavych zistit wo co gou? \r\n<br>\r\n<br><b>Let the show begin...</b>\r\n<br>\r\n<br>Ako je z nadpisu jasne jednalo sa o Session, takze take pohodove stretnutie ludi co maju radi extremne sporty spate s ulicou. Bikerov doslo hadam okolo 30 a skaterov okolo 15 a dokonca aj jeden extreme-in-linista z Oscadnice.\r\n<br>\r\n<br>\r\n<b>Bikers</b>\r\n<br>Bez pochyby najvecsou jazdeckou atrakciou bol velky funbox na ktory sa nakoniec odhodlali traja krali Tomas, Typek a Ja...bola to ozaj vrazda... Tomas sa rozdebol ako keby trenoval drahovu cyklistiku...ja sa pozeram to neni mozne...vyletel asi 5 m a dopadol az na samotny koniec a f pohode to vratil. Typek sa nenechal dlho prehovarat a pokrstil ho takisto, ja som si tiez fajne poskakal. Troska strach-nahanajuce situacie nastali, ked letel Tomas a za nim hned Typek..Tomasovi smyklo predne koleso, brutalna drzka, Typek leti priamo nanho, ja blednem, ale nakoniec vsetko dobre dopadlo hadam len s par narazeninami, modrinami a skrabancami. Cestnu lisaj na celu lavu ruku a nohu som chytil aj ja o chvilu neskor.\r\n<br>O kvalitne veci sa postaral aj Martin pri svojich Flatlandovych kreaciach (to je ten co sa tak tocil na tom malom bicykli na prednom kolese), Milan s trialovymi trikmi.\r\n<br>\r\n<br>\r\n<b>Skaters:</b>\r\n<br>Dosli chalani zo Skaliteho a treba povedat, ze vedia co to je zodrat grip na doske...flipy, ollies, grindy, slidy padali ako na beziacom pase...respek chalani... Sem tam im do cesty vbehli aj mladasi na ktorych vidno, ze sa snazia a chcu byt ako ten ujo Toncek Hafk ktoreho videli v tekle.\r\n<br>O spestrenie sa postaral aj breaker DaNo, ktoremu stacil stary koberec aby ukazal ako sa daju zlomit kosti na pockanie, teda minimalne to tak vyzeralo...respekt\r\n<br>\r\n<br>\r\n<b>Dj\'s:</b>\r\n<br>Po cely den hrali Sojka a TheZko svoje party sety poprekladane hustymi skrecmi, akoze ja som si vzdy myslel, ze gramofony leteli ked bola moja babka mlada, ale toto....dikeZz chlapi postarali ste sa z velkej casti o zabavu!\r\n<br>\r\n<br>\r\n<b>Co dodat?</b>\r\n<br>Totalne narvane lavicky pred Countrickom, vela jazdcov a hafo ludi po celom areali boli len dokazom toho, ako velmi su v terajsej dobe popularne extremne sporty...\r\n<br>\r\n<br>Podakovanie patri najme firme Fox Roof ktora zabezpecila prekazky, mestu za priestory, DomBytu za el. energiu, milej tete vratnicke, vsetkym, ktori mi s tym pomohli a samozrejme vsetkym zucastnenym na ktorych som zabudol...diky ludia, takychto impulzov potrebujeme urcite vsetci do zivota ovela viac, nech to ma kurwa neaky zmysel...<br><br>', 'admin', , 57),
(17, 1159826400, 'Report: Sewer Underground Party # 4', 'V sobotu sa konala este jedna nadupana akcia!!! A to Sewer Underground Party cislo 4, o ktorej organizaciu sa postaral Team Sewer.sk. <br>Ty mas moznost zistit, ak si tam nebol, ako to na uz v poradi stvrtej party prebiehalo...<br><br><BR><A HREF=\'site.php?x=1&id=17\'><B>VIAC...</B></A>', 'V sobotu sa konala este jedna nadupana akcia!!! A to Sewer Underground Party cislo 4, o ktorej organizaciu sa postaral Team Sewer.sk. <br>Ty mas moznost zistit, ak si tam nebol, ako to na uz v poradi stvrtej party prebiehalo...\r\n<br>\r\n<br>\r\nJe chvilu pred osmou, vchadzam dovnutra, napoli naplneny klub, hip-hop beatz....\'Aah konecne doma.\' si hovorim.\r\n<br>Ovela vecsiu radost som dostal, ked som zistil, ze drviviu vecsinu navstevnikov tvoria moji znami...\'Dnes je o zabavu postarane aj kedy neboli rosky.\'\r\n<br>\r\n<br>Ako prvy sa za gramce postavil DJ Soya, ktori si prsty rozcvicoval cely den a bolo to vidiet a hlavne pocut...party hity, ktore pustal nas nutili pohybovat aspom rukami a hlavami, kedze sme sedeli za stolom.\r\n<br>No pri stole sme sa dlho neobhriali, lebo chvilu po deviatej na parket nastupuju Komando Crew! Poviem tomu asi tolko ze DaNo a ostatni su asi z gumy... krkolomne kombinacie, salta styroch ludi naraz, kebyze som vedel ako sa to vsetko vola, tak toho napisem na stranu...proste respekt chalani...Cadca zije!\r\n<br>\r\n<br>\r\nVysli sme vom sa nadychat, pohaluzit, povdychovat, pokecat a uz sme sa hrnuli nas5 lebo SQRATCHBOX a.k.a. Pindo a TheZ a.k.a. OSC a CA zacinali svoju show! Treba povedat, ze to mali perfektne premyslene, vec po veci, mali svoj program, a ked si zrovna zvukar nehonil pero a nebuchal pri tom do gombikov, tak to aj dobre znelo!\r\n<br>\r\n<br>\r\nPo nich sa za gramce stava DJ Pedro aby ukazaj coho je schopny, zase tancujeme a haluzime sa...\r\n<br>\r\n<br>\r\n<b>[OPRAVA]</b>\r\n<br>\r\nHned na to zautocili na nase usne bubienky Zilinsky chalani Rapidemente, ktorych som zmeskal, ale vraj to bola zas ako vzdy sou...\r\n<br>\r\n<b>[/OPRAVA]</b>\r\n<br>\r\n<br>\r\nPo chvili sa nachadzam opet na parkete a akurat zacinali Original Flow, chalani z Martina a musim priznat, ze iked som poznal len 2 veci(ktore som samozrejme isiel s nimi), pacili sa mi, ako textovo tak hudobne, urcite maju prespektivu...\r\n<br>\r\n<br>\r\n<b>Co dodat?</b>\r\n<br>Dalsia TheZova nadupana akcia, na ktoru prislo z nevysvetlitenych dovodov menej ludi....no a co, ja som sa bavil na 100%... peace\r\n<br><br>', 'admin', , 85),
(18, 1159999200, 'Mame fotky z LZK Bike Session a Sewer Underground #4', '<b>Takze Takze!!!!</b>\r\n<br>Po troska dlhsej dobe, ale predsa vam LZK prinasa exkluzivne nove fotografie z Lzk bike session a Sewer Underground party vol 4...\r\n<br>\r\n<br>\r\n<BR><A HREF=\'site.php?x=1&id=18\'><B>VIAC...</B></A>', '<b>Takze Takze!!!!</b>\r\n<br>Po troska dlhsej dobe, ale predsa vam LZK prinasa exkluzivne nove fotografie z Lzk bike session a Sewer Underground party vol 4...\r\n<br>\r\n<br>\r\nPre fotky z Bike Sessionu chodte cez menu Ex-sports -- > bike (tam su vsetky), alebo kliknite <a href=\'site.php?x=22\'><b>sem</b></a>\r\n<br>\r\n<br>\r\nA pre fotoze z party chodte cez menu Parties -- > CA underground 4, alebo kliknite <a href=\"site.php?x=50\"><b>sem</b></a>\r\n<br>\r\n<br>\r\n', 'admin', , 124);
