(1, 1145656159, 'admin', 'Poprosim KAZDEHO z vas o reakciu, nech viem, ako by to malo vyzerat, takze aj ked\r\nneviete co to ta weno-crew vobec je, prosim, <B>VYJADRITE SVOJ NAZOR NA TUTO\r\nSTRANKU!!!</B>', '84.47.24.31'),
(2, 1145656502, 'turque', 'sedim w skole a ide ma jebnu&#357; mam 4 prewierky a newiem ni&#269; asi sa skurim\r\nzdar hip-hop nie je mrtwy', '84.47.24.31'),
(3, 1145656523, 'turque', 'bolo by dobre keby sa tu dali fotky s GURU a peter ma jebowe nahrawky na mobe hip-hop\r\nnie je mrtwy', '84.47.24.31'),
(4, 1145656536, 'admin', 'Dal som tu novy update pribudli sekcie sketches haluze stickers Party sekcia (zatial\r\n7 party\'s) Ten party list budem este doplnat, mam este vela inych fotiek, ale este\r\npotrebujem prebrat s vami, ci to tam mam dat vsetko, t.j. vase xichty tam je vidno...', '84.47.24.31'),
(5, 1145656560, 'admin', '4 all: sak mi davajte setko, co mate a co tu chcete mat... A ozaj, vybavujem dalsi\r\nwebhosting na stranke STARNOW.WI.CZ (STAR-HVIZDA; NOW-TERAZ)alebo(STAR-Stara\r\nbystrica; NOW-Nova bystrica)!! bude to rychlejsie a pre mna lepsie, inak obsah ostane\r\nnezmeneny. dikezz W za napad...', '84.47.24.31'),
(6, 1145656577, 'wirus_weno_crewwww\r\n', 'aloha chlapci s konca!tesim sa,ze sa na tom maka!asi po x-krat a_P_d_S_m_W_in(cekuj\r\nmail) moja osobna poklona!treba wymyslat napady a napady!dik za motiwaciu!hadam nas\r\nto nedojebe:)BT wykalenci cusek.mieeeeeeeer', '84.47.24.31'),
(7, 1145656586, 'admin', 'tak ja neviem, snad to forum uz pojde..', '84.47.24.31'),
(8, 1145656596, 'adm', 'tw: uz mam skoro hotovy novy engine...', '84.47.24.31'),
(9, 1145656606, 'adm', 'nechcem to tu davat po kuskoch, to tu dam naray nech to je riadne prekvapko, ale asi\r\najtak iba pre mna, lebo tu stejnak nigdo nechodi...', '84.47.24.31'),
(10, 1145656619, 'adminiDemonstrator', 'ets demonstrate this shit!!!', '84.47.24.31'),
(11, 1145656645, 'w_i_r_u_s.WENO', 'ciaoLukas!neboj wsetko bude O.K.!teda cez wykend to nejak posunieme dalej!!neboj a\r\ndrz te sa!cusek a zdrawim mojich FELAS!mier', '84.47.24.31'),
(12, 1145656660, 'adm', 'Taxomsa neudrzal, a dal to tu, neni to hotove, ale... Lucka uzdrav sa!', '84.47.24.31'),
(13, 1145656671, 'admn', 'Tak zas dalsia verzia...rychlejsia..', '84.47.24.31'),
(14, 1145656681, '..w..', 'Nazdarek!!tak sme sa zas posunuli!!je to super..aj ked bude treba nieco pomenit,wed\r\naj Rym nepostawili za par dni!:).zatim dik.WENOreprezent!!', '84.47.24.31'),
