(175, 1159306029, 'admin', 'Tak som sa rozhodol, ze volaco napisem....Aby bolo jasne tato session, bude PRVA v historii Cadce!!! NIKTO nikdy take nieco este nevidel!!! (A ak nespravime dalsiu ani neuvidi) Kazdeho, koho stretnem, mi praje, nech sa nam to podari, lebo ze v tejto skurvenej diere sa nic nedeje. Kazdy tu len fetuje, chalsta a mrha talentami! Takze prosim vas, ide asi tak o to, ze nikto iny okrem VAS nic podobne nerobi!!! Tak sa kurwa dostavte, nech nepatrite medzi tych, co kapruju a vela kecaju a nedepkujte a podte pojazdit!!! Odjakziva som snival ako to musi byt super v  \"Meste\": Graffiti, DJ\'s, Sk8ters, ale postupom casu som prisiel na to, ze Cadca a ktorekolvek ine mesto je len zfetovana diera, kde zije len par typkov, co to dvihaju hore a to sme prave MY!!! Takze zabudnime na vsetky depresie a podme tym nulam ukazat, ze take nieco ako my v zivote NEDOKAZU!!!', '87.197.134.200'),
(176, 1159343449, 'wifonkah', 'pripajam sa k adminowi ;) ja tiez nist newiem ale aspon si zajazdim :)', '158.196.44.154'),
(177, 1159355248, 'dhbiker', 'nie som freestyler ale tesim sa na to ako male decko a ak mam pravdu povedat ani ma netrapi ze nic neviem ... ale jednoducho tento tyzden yijem ibz preto ', '213.81.187.103'),
(178, 1159370486, 'eXcutionersMP', 'Jasne admin.To mas recht!Dojdite vsetci co na necom jazdite!No a ked si hovorite ze jebete na to ze co stoho budete mat tak ste tupci!Chlapi mozno zbalite nejaku abo nejake babeny date svoj sen trojku a  este si aj kvalitne zajazdite heheheee!!!Mjr! SWR UNDR & LZK DAY sobotaaaaaaaa!!!!\r\n', '84.47.29.167'),
(179, 1159437341, 'Typek', 'ou &#381;eah will show them what we got !!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!! We will kicke their asses!Zajtra to uz ideme robit\r\n', '213.81.187.101'),
(180, 1159554982, 'Typek', 'BORDEEEEEEEEEEEEEEEEEEEEEEEEL ', '213.81.187.101'),
(181, 1159560570, 'admin', 'YYYYYYYYYEEEEEEEEEEAAAAAAAAAHHHHHHHHH!!!!!!!!', '87.197.216.22'),
