(185, 1159696514, 'Typek', '2all supporters: chalani dakujem ze sme taketo nieco urobili co bolo vcera bolo perfektne dakujem :)\r\n', '213.81.187.101'),
(186, 1159696737, 'Pindo-akai', 'chalani vcera fakt ze respekt... session bol kruto husty... lzk-ok... mjer a len tak dalej...', '87.197.214.241'),
