(189, 1159706379, 'Dhbiker', '4Wifonkah: to neva v poho', '87.197.172.75'),
(190, 1159707303, 'pastwos', 'Takze fcera wrazda, dikeZz pre wsetkych co prisli pojazdit na Session, chalani len tak dalej! Respect pre setkych SkataZz, BikaZz, In-linaZz, BreakaZz... Tomasa, Typka, Mata ...Soya, TheZ... Fsecja ste Ulica ;) Ulica Zije!', '84.47.9.191'),
(191, 1159712043, 'kLaXon (guest/skate)', '4admin and all: myslim ze to tu je diera, ale ak sa daju ludia dohromady a zahodia chlast, drogy a podobne veci za hlavu a zacne to tu zit sportom, uz sa to za dieru nebude dat pokladat. Len to treba rozbehnut. Chlapi som rad ze ste tu a podporujete eX-treme sporty... Treba pozdvihnut Cadcu na nejaku lepsiu uroven. Skoda ze to hlavne som v Sobotu, teda vcera, zmeskal ale dufam ze sa to na tomto webe objavi. A keby daco, drzim s vami.', '213.151.217.142'),
(192, 1159813212, 'dhbiker', '2all: spolu snad nie&#269;o porie&#353;ime', '87.197.180.130'),
(193, 1159819204, 'Typek', 'also it has to be crowned by sound :)', '213.81.187.101'),
(194, 1159873692, 'joSko_sewer_crew', '..hohohohohovada..dobre to tam bolo..aj potom party,..strasne cosi..posielam pis a zase niekedy!!!jak motyka vystreli snad este aj tento rok!!!(:p\r\nwww.sewer.sk', '87.197.215.52'),
