(205, 1160144141, 'paStWos', '<b>4 Typek:</b> No neni si pri jazdeni, nedokazem si to vysvetlit, ale je to asi tim, ze ta nikto neodfotil (mal si povedat)....nabuduce zaplatime fotografa ;-)', '84.47.97.225'),
(206, 1160148275, 'dzjeah', 'neviem k tomu reportu by som rad cosi dodal a to asi tolko ze rapidamente isli pred original flow to znamena ze si ich nezaspal ale obycajne zmeskal co sa mi zda dost nefer ked report tak pisem o setkom a ked som to nestihol tak si pozistujem aka je to potom korektnost k skupinam\r\n', '85.216.147.34'),
(207, 1160151836, 'admin', '<b>4 dzjeah</b> Tak uz som to opravil, mas pravdu, mal by som si to zistit, aby tyo bolo minimalne tak kvalitne ako na Hip-Hop.sk, ved taketo fiasco si nemozeme dovolit! Ale inak som naozaj rad, ZE TO RIESITE, znamena to, ze vam LZK nieje lahostajne ;)', '87.197.108.72'),
(208, 1160156904, 'Typek', 'chcem podakovat vsetkym ludom typu chalanom co su somnou a to su (Tomas,Paswtos.,Martin,Wifon.)za to ako ste somnou za to ze bez vas by som nebol tam kde som teraz a pomohly ste mi dakujem za vsetko a chcem podakovat za to ze ste mi otvorili dvere novych moznosti ', '213.81.187.101'),
(209, 1160156949, 'Typek', 'este raz dik !!!!!!!!!!', '213.81.187.101'),
