INSERT INTO `news` (`nr`, `time`, `text`) VALUES
(1, 'o2.o2.2oo6', 'Vznikla tato\r\nstranka vzhladom k\r\ntomu, ze som sa\r\ncitil mizerne a\r\nchcel som neak\r\nzabit zlu naladu,\r\nale SNB nebol\r\npoblizku, tak som\r\nsa rozhol nieco\r\nnapisat a asi sa\r\noplatilo :)'),
(2, 'o3.o2.2oo6 -\r\n12.o2.2oo5', 'Stranka presla\r\nmnohymi zmenami,\r\nci uz obsahovymi,\r\nalebo funkcnymi. V\r\nsucastnosti\r\nvyuzivam Html,\r\nphp, css a js,\r\nplanujem SQL.'),
(6, '28.o3.2oo6', 'Zmenene menu,\r\npracuje\r\nrychlejsie,\r\nstranka funguje\r\npre IE, Opera,\r\nMozilla, Mozilla\r\nFirefox, ale len\r\nnovsie verzie.\r\nDoplnene\r\nFotky..mjr'),
(11, 'o8.o7.2oo6\r\n', 'od 10.7.2006 admin\r\n(ja) odchadzam na \r\nbrigadu na 10 dni,\r\n takze ak sa nieco\r\n nelubi, napiste d\r\no fora. Pribudla 1\r\n fotka od BESa(wri\r\nte) a Fotky z bike\r\nsessionu (ex-sport\r\ns->bike). A ozaj, \r\nMAME NOVU STRANKU!\r\n!!\r\n'),
(12, 'Kontakt na admina', 'Mail: fsMTB@seznam.cz\r\nICQ: 232149501\r\nMobil: 0908247988\r\n\r\n'),
(13, '', 'Pribudla 1 foto sk8 a Najstarsi grafaz...a v XTMcrew su uplne nove fotoZze...'),
